    SetupFunctionalContent,
    SetupFunctionalContainer,
    SetupHeroContainer,
    SetupStepIcon,
    SetupWrapper, SetupHeroStyling, SetupH1, SetupH2, SetupH3
} from "../styled/Setup.styled";
import {LoginSubtitle, LoginTitle} from "../styled/Login.styled";
import Hero from "../assets/batman-robin-heroes.svg"

function Thanks() {
    return (
        <SetupWrapper>
            <SetupHeroStyling/>
            <SetupFunctionalContainer>
                <SetupFunctionalContent>
                    <SetupStepIcon className="bi bi-house-door"></SetupStepIcon>
                    <SetupH1>Merci</SetupH1>
                    <SetupH2 last={true}>Vous êtes désormais inscrit !</SetupH2>
                    <SetupP></SetupP>
                </SetupFunctionalContent>
            </SetupFunctionalContainer>
            <SetupHeroContainer>
                <img src={Hero} className={"setup-hero"}/>
            </SetupHeroContainer>
        </SetupWrapper>
    );
}

export default Thanks;
